import React from "react";
import { Jumbotron, Form, Button, Dropdown } from "react-bootstrap";
import { DropdownButton } from "react-multiselect-dropdown-bootstrap";
export const AddTicketForm = (handleOnChange, handleOnSubmit) => {
  return (
    <Jumbotron>
      <Form autoComplete="off" onSubmit={handleOnSubmit}>
        <Form.Group>
          <Form.Label>Sujet</Form.Label>
          <Form.Control
            type="subject"
            name="subject"
            onChange={handleOnChange}
            //value={email}
            placeholder="Entrez votre addresse email"
            required
          />
        </Form.Group>
        <Form.Group>
          <Form.Label>Date de reclamation</Form.Label>
          <Form.Control
            type="date"
            name="IssueDate"
            onChange={handleOnChange}
            //value={pass}
            placeholder="Mot de passe"
            required
          />
        </Form.Group>
        <Form.Group>
          <Form.Label>Les details</Form.Label>
          <Form.Control
            as="textarea"
            //type="date"
            name="details"
            onChange={handleOnChange}
            //value={pass}
            placeholder="Mot de passe"
            required
          />
        </Form.Group>

        <Form.Group>
          <Form.Label>Priorit√©</Form.Label>
          <DropdownButton
            alignRight
            title="Dropdown right"
            id="dropdown-menu-align-right"
          >
            <Dropdown.Item eventKey="option-1">option-1</Dropdown.Item>
            <Dropdown.Item eventKey="option-2">option-2</Dropdown.Item>
            <Dropdown.Item eventKey="option-3">option 3</Dropdown.Item>
            <Dropdown.Divider />
            <Dropdown.Item eventKey="some link">some link</Dropdown.Item>
          </DropdownButton>
        </Form.Group>
        <Button type="submit" variant="info">
          Envoyer
        </Button>
      </Form>
    </Jumbotron>
  );
};
